const reducer = (state, action) => {
	switch (action.type) {
		case 'SHOW_SETTINGS':
			return { ...state };
		case 'SAVE':
			console.log("ZAPISUJE")
			return { ...state };
		case 'LOAD':
			return { ...state };
		default:
			return state;
	}
};

export default reducer;
